import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Import necessary components from react-router-dom

// Other imports...

function App() {
  return (
    <Router>
      <Navbar />
      <div className="content">
        <Routes>
          {/* Define your routes here */}
          <Route path="/register" element={<Registration />} />
          <Route path="/login" element={<Login />} />
          <Route path="/payment-status" element={<PaymentStatus />} />
          <Route path="/notice-board" element={<NoticeBoard />} />
          <Route path="/calendar" element={<Calendar />} />
          <Route path="/menu" element={<Menu />} />
          <Route path="/feedback" element={<FeedbackForm />} />
          <Route path="/timings" element={<Timings />} />
          {/* Admin Routes */}
          <Route path="/admin/meal-plan" element={<MealPlan />} />
          <Route path="/admin/attendance" element={<AttendanceReport />} />
          <Route path="/admin/inventory" element={<InventoryManagement />} />
          <Route path="/admin/billing-history" element={<BillingHistory />} />
          <Route path="/admin/reports" element={<ReportAnalytics />} />
          <Route path="/admin/feedback-analysis" element={<FeedbackAnalysis />} />
          {/* Add more routes as necessary */}
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
